const Index = ({test}) => {
  console.log(test)
  return (
    <div>

    </div>
  )
}

Index.getInitialProps = async ({ reduxStore, req }, ctx) => {
  const isServer = !!req
  if (isServer) {
    console.log(ctx)
    //await reduxStore.dispatch(changeValue('Hello world'))
  }
  else reduxStore.dispatch(changeValue('Hello world'))
  return {}
}

const mapStateToProps = state => {
  return {
    test: state.test
  }
}

